import React from 'react';

//Components
import Game from './Game.js';

const GameTable = () => {
    const o = {title:'God of var',genre:'Actions',played:true};


    return (
        <div>
            <table class="table">
                <thead>
                    <tr>
                    <th scope="col">First</th>
                    <th scope="col">Last</th>
                    <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    <Game props={o} />
                </tbody>
            </table>

        </div>
    );
};

export default GameTable;
